  CardTitle,
  Col,
  Slider,
  Slide,
  Caption,
} from "react-materialize";
import "materialize-css";

const Certyfikaty = () => {
  return (
    <div>
      <Row>
        <Col m={6} s={12} push="m3">
          <Card className="orange darken-1 z-depth-2 klienci">
            <div className="center white-text">
              <h4>Nasze certyfikaty</h4>
              <Divider />
